class Mouse extends MonoBehaviour {
  @SerializeField
  speed = 5;

  anim: Animator;
  rb: Rigidbody;
  cam: Camera;
  mouse: Mouse;

  Start() {
    this.anim = this.GetComponentInChildren(Animator);
    this.cam = this.GetComponentInChildren(Camera);
    this.rb = this.GetComponent(Rigidbody);
    this.mouse = GameObject.FindObjectOfType(Mouse);
  }


  Update() {

    let h = Input.GetAxis("Horizontal");
    let v = Input.GetAxis("Vertical");

    //TODO Fix ClampMagnitude!
    let input = Vector3.ClampMagnitude(new Vector3(h, 0, v), 1);
    input.scaleInPlace(this.speed);

    if (input.sqrMagnitude > 0.1) {
      this.rb.angularVelocity = Quaternion.ToEulerAngles(Quaternion.FromToRotation(this.transform.forward, input), new Vector3());
    } else {
      this.rb.angularVelocity = new Vector3();
    }
    input.y = this.rb.velocity.y;

    this.rb.velocity = input;



    if (input.magnitude > .1) {
      this.anim.Play("Running", 0.1);
    } else {
      this.anim.Play("Idle.001", 0.1);
    }
  }
}

code.Doozy.ts:
//Doozy.ts

class Doozy extends MonoBehaviour {
  @SerializeField
  speed = 5;

  @SerializeField
  stoppingDistance = 1;

  anim: Animator;
  rb: Rigidbody;
  mouse: Mouse;

  Start() {
    this.anim = this.GetComponentInChildren(Animator);
    this.rb = this.GetComponent(Rigidbody);
    this.mouse = GameObject.FindObjectOfType(Mouse);
  }

  Update() {
    let direction = this.mouse.transform.position.negate(this.transform.position);
    direction.y = 0;
    this.rb.angularVelocity = Quaternion.ToEulerAngles(Quaternion.FromToRotation(this.transform.forward, direction.scale(-1)), new Vector3());
   // this.transform.localRotation = Quaternion.LookRotation(direction.scale(-1), new Vector3(0,1,0));
    if (direction.magnitude > this.stoppingDistance) {
      this.rb.velocity = direction.normalized.scale(this.speed);
      this.anim.Play("Running", 0.1);
    } else {
      this.rb.velocity = new Vector3();
      this.anim.Play("Idle.001", 0.1);
    }    
  }
}

